import React, {useState, useEffect} from 'react';
import Axios from 'axios';




const LandingPage= ()=> {
      const [roomId, setRoom] = useState('null');
      const createroom = ()=> {
        Axios.get('http://localhost:5000/',{
          cors: {
            origin: "http://localhost:3000",
            methods: ["GET", "POST"]
          }
        }).then((res) =>{
          setRoom(res.data.link);
          
      });
        };

      return (<React.Fragment>
      <div><button onClick={createroom}> Create Room</button></div>
      <div><input name="roomIduser" type="text" value="" placeholder="Your Name" /></div>
      <div><button onClick={()=>{console.log('yeah!')}}> Join Room</button></div> 
      {roomId}
      </React.Fragment>
      )
};

export default LandingPage;
